import React, { Fragment } from 'react';
import PropTypes from 'prop-types';

const NuevoProyecto = props => {
    return (
        <Fragment>
            <button
                type="button"
                className="btn btn-block btn-primario"
            >Nuevo Proyecto</button>

            <form className="formulario-nuevo-proyecto" >
                <input type="text" className="input-text" placeholder="Nombre del proyecto" name="nombre" id="" />
                <input type="submit" className="btn btn-primario btn-block" value="Agregar Proyecto" />
            </form>
        </Fragment>
    );
};

NuevoProyecto.propTypes = {

};

export default NuevoProyecto;
